function Paragrafos() {
    return (
    <>
 
   <div className=" row  bg-danger  ">
   
    <div className="col-12 align canter">
      
    
   
        <h1> Todos os projetos integrados das ETE's Conectados em um só Lugar</h1>
        <p>O Repositorio conect ETE PE é uma base de dados online que objetiva reunir,de forma organizada e acessível , a produção cientifica e  documental das ETE'S de toda RMR , com o intuito de torná-la acessível aos pesquisadores e ao grande publico nacional e internacional.</p>
       
        </div>
    
   </div>
    
    </>
    )
  }
  
  export default Paragrafos;
